def maxPrimeProduct(arr):
    count = {}
    for el in arr:
        if el not in count:
            count[el] = 1
        else:
            count[el] += 1
    primes = [2, 3, 5, 7]
    if 1 not in count:
        for prime in primes:
            if prime in count and count[prime] >= 2:
                return prime * prime
            elif -prime in count and count[-prime] >= 2:
                return -prime * -prime
    return -1

